DELIMITER $$
CREATE TRIGGER `delete_product` AFTER DELETE ON `products` FOR EACH ROW begin
insert into products_delete
(id_produk,
kode_produk,
nama_produk,
gambar,
harga,
stok,
keterangan,
kategori,
tgl_hapus,
nama_user
)
values
(old.id_produk,
old.kode_produk,
old.nama_produk,
old.gambar,
old.harga,
old.stok,
old.keterangan,
old.kategori,
SYSDATE(),
current_user
);
end
$$
DELIMITER ;

